INSERT INTO `user_contracts` VALUES (1,1,'2023-01-01','2023-04-01','2023-12-31','Software Engineer',1,'Kenya','Develop and maintain software applications.','John Doe',10000,0,'2025-01-25 09:37:39','2025-01-25 12:11:00'),(2,2,'2024-12-01','2025-01-31','2027-05-09','N/A',3,'Kenya','N/A','N/A',60000,0,'2025-01-26 10:01:51','2025-05-09 13:18:39'),(3,3,'2024-10-01','2024-11-30',NULL,'Digital Marketer',1,'Kenya','Technology Consulting','Joseph Njega',25000,0,'2025-01-26 10:01:52','2025-06-19 10:16:13'),(4,4,'2024-11-04','2025-05-14',NULL,'Business Development Executive',1,'Kenya','N/A','Sylvia Ngurela',30000,0,'2025-01-26 10:01:52','2025-06-19 10:17:28'),(5,5,'2024-11-15','2025-01-14','2026-05-31','Business Development Specialist',7,'Kenya','N/A','N/A',47928,0,'2025-01-26 10:01:52','2025-06-19 10:18:41'),(6,6,'2024-11-11','2025-01-10',NULL,'Human Resource Officer',3,'Kenya','N/A','N/A',45000,0,'2025-01-26 10:01:53','2025-01-26 10:01:53'),(7,7,'2024-11-11','2025-01-11','2025-05-16','Business Development Executive',1,'Kenya','N/A','Sylvia Ngurela',30000,0,'2025-01-26 10:01:53','2025-09-05 10:05:36'),(8,8,'2023-08-07','2023-11-07','2027-05-09','Project Coordinator',1,'Kenya','Project Management\nProject Planning & Initiation\n\nDefine project scope, goals, deliverables, and timelines in alignment with organizational objectives.\n\nDevelop detailed project plans, schedules, and resource allocation strategies.\n\nIdentify risks, dependencies, and constraints early in the project cycle.\n\nTeam Leadership & Coordination\n\nLead, guide, and motivate project team members to achieve objectives.\n\nAssign tasks, monitor performance, and provide support or feedback.\n\nFacilitate collaboration and resolve conflicts within the team.\n\nStakeholder Management\n\nAct as the primary point of contact between the project team, management, and stakeholders.\n\nCommunicate project updates, progress, and challenges clearly and timely.\n\nManage stakeholder expectations and ensure alignment with project objectives.\n\nExecution & Monitoring\n\nOversee day-to-day project implementation to ensure milestones are achieved.\n\nMonitor progress against set targets, timelines, and budgets.\n\nTrack performance metrics and prepare regular status reports.\n\nQuality Assurance & Risk Management\n\nEnsure project deliverables meet required standards and specifications.\n\nIdentify, assess, and mitigate risks that could affect the project.\n\nImplement corrective measures for issues or delays.\n\nBudget & Resource Management\n\nManage project budgets, ensuring cost efficiency and accountability.\n\nOptimize the use of human, financial, and material resources.\n\nApprove project expenditures within authorized limits.\n\nDocumentation & Reporting\n\nMaintain comprehensive project documentation, including plans, reports, and evaluations.\n\nPresent updates to senior management and recommend process improvements.\n\nEnsure proper project closure and knowledge transfer after completion.\n\nContinuous Improvement\n\nCapture lessons learned for future projects.\n\nRecommend process enhancements to improve project delivery efficiency.\n\nFoster innovation and encourage best practices in project management.','Micheal Gitaka',70000,0,'2025-01-26 10:01:53','2025-09-05 11:02:44'),(9,9,'2023-05-01','2023-05-01',NULL,'N/A',1,'Kenya','N/A','N/A',90000,0,'2025-01-26 10:01:54','2025-01-26 10:01:54'),(10,10,'2019-07-26','2019-09-26',NULL,'Finance And Administration Specialist',2,'Kenya','In SCG, the Finance and Administration department plays a crucial role in ensuring the smooth operation of the business.  Key duties:\n1.	Financial Management:\n•	Budgeting and Forecasting: Develop and manage budgets in collaboration with department heads and leadership.\n•	Financial Reporting: Generate and analyze financial reports to provide insights for decision-making.\n•	Expense Management: Oversee and control expenses to ensure financial sustainability.\n•	Invoicing and Billing: Manage client invoicing and billing processes, ensuring accuracy and timeliness.\n•	Accounts Payable/Receivable: Supervise accounts payable and receivable functions to maintain healthy cash flow.\n2.	Payroll Administration:\n•	Payroll Processing: Ensure accurate and timely payroll processing for all employees.\n•	Tax Compliance: Stay updated on tax regulations and ensure compliance with relevant tax laws.\n3.	Administrative Management:\n•	Office Management: Supervise office facilities and ensure a conducive working environment.\n•	Procurement: Oversee procurement processes for office supplies and equipment.\n•	Vendor Management: Manage relationships with external vendors and service providers.\n•	Travel Coordination: Arrange travel logistics for employees as needed.\n4.	Compliance and Risk Management:\n•	Legal Compliance: Ensure the firm adheres to all relevant legal and regulatory requirements.\n•	Risk Assessment: Identify and mitigate financial and operational risks.\n5.	Human Resources Support:\n•	Personnel Records: Maintain accurate and up-to-date employee records.\n•	Benefits Administration: Administer employee benefits programs.\n•	Leave Management: Track and manage employee leave records.\n6.	Financial Analysis:\n•	Cost-Benefit Analysis: Conduct analyses to support decision-making processes.\n•	Financial Planning: Contribute to long-term financial planning and strategy development.\n7.	Technology and Systems:\n•	Financial Systems: Oversee the implementation and optimization of financial management systems.\n•	Data Security: Ensure the security and confidentiality of financial and administrative data.\n8.	Communication and Collaboration:\n•	Interdepartmental Collaboration: Work closely with other departments to support their financial and administrative needs.\n•	Reporting to Leadership: Provide regular updates to the leadership team on financial and administrative matters\nADDITIONAL ROLES CONSULTANCY\n1.	Tendering for Jobs:\n•	Market Analysis: Conduct thorough market research to identify potential opportunities and assess market trends.\n•	Proposal Development: Prepare compelling and well-structured proposals in response to tender invitations.\n•	Bid Coordination: Coordinate the tendering process, collaborating with various teams to gather necessary information and ensure timely submission.\n•	Relationship Building: Cultivate and maintain relationships with clients and key stakeholders during the tendering process.\n2.	Report Writing after Training:\n•	Training Evaluation: Assess training effectiveness and gather feedback to enhance future programs.\n•	Documentation: Prepare comprehensive training reports summarizing key outcomes, participant feedback, and areas for improvement.\n•	Recommendations: Provide actionable recommendations based on training evaluations to enhance the overall training strategy.\n3.	Strategic Plan Development (Clients):','Michael Gitaka',80000,0,'2025-01-26 10:01:54','2025-09-05 10:52:29'),(12,12,'2015-10-01','2015-12-01',NULL,'Manager Business Development',1,'Kenya','The Business Development Executive is responsible for identifying new business opportunities, building and maintaining strong client relationships, and driving revenue growth. The role focuses on market research, lead generation, pitching products or services, and negotiating contracts to achieve business goals.\n\nKey Responsibilities\n\nBusiness Growth & Sales\n\nIdentify and pursue new business opportunities in target markets.\n\nDevelop and implement strategies to achieve sales targets.\n\nPrepare and deliver persuasive business proposals and presentations.\n\nNegotiate and close deals that drive company revenue.\n\nClient Relationship Management\n\nBuild and maintain long-term relationships with clients and partners.\n\nServe as the primary point of contact for new and existing customers.\n\nEnsure client satisfaction and manage post-sales follow-up.\n\nMarket Research & Analysis\n\nConduct market research to identify trends, customer needs, and competitor activities.\n\nProvide insights and recommendations to guide product and service positioning.\n\nExplore opportunities for expansion into new markets.\n\nCollaboration & Reporting\n\nWork closely with marketing, operations, and finance teams to support business initiatives.\n\nMaintain accurate sales records, forecasts, and reports.\n\nParticipate in trade shows, networking events, and industry conferences to promote the company','Michael Gitaka',80000,0,'2025-01-26 10:01:54','2025-09-05 10:38:27'),(13,13,'2011-11-20','2012-01-20',NULL,'Operations Manager',5,'Kenya','The Operations Manager is responsible for overseeing the day-to-day business operations to ensure efficiency, productivity, and profitability. The role involves managing people, processes, and resources, while ensuring compliance with company policies, quality standards, and customer requirements.\nKey Responsibilities\n\nOperational Planning & Strategy\n\nDevelop and implement operational policies, procedures, and systems to support the company’s goals.\n\nAlign operational activities with strategic objectives for growth and efficiency.\n\nProcess & Performance Management\n\nMonitor and evaluate the efficiency of operational processes and recommend improvements.\n\nEstablish performance metrics and ensure targets are achieved.\n\nOversee logistics, supply chain, and resource allocation.\n\nTeam Leadership & People Management\n\nSupervise, mentor, and motivate staff to achieve performance goals.\n\nRecruit, train, and develop employees in line with organizational needs.\n\nFoster a positive workplace culture that encourages teamwork, accountability, and innovation.\n\nFinancial & Resource Management\n\nPrepare and manage budgets for operations.\n\nOptimize use of resources to control costs and maximize profitability.\n\nEnsure compliance with financial controls and reporting requirements.\n\nCustomer Service & Relationship Management\n\nEnsure timely and quality delivery of products/services to customers.\n\nHandle escalated customer concerns and implement service improvement initiatives.\n\nMaintain strong relationships with clients, suppliers, and stakeholders.\n\nCompliance, Risk & Quality Control\n\nEnsure adherence to legal, health & safety, and regulatory requirements.\n\nDevelop risk management strategies to safeguard company assets and operations.\n\nImplement quality control standards and continuous improvement programs.\n\nQualifications & Skills\n\nBachelor’s degree in Business Administration, Operations Management, or a related field (MBA preferred).\n\nProven experience (5+ years) in operations management, preferably in [insert industry].\n\nStrong leadership, organizational, and decision-making skills.\n\nExcellent communication and interpersonal abilities.\n\nProficiency in operations management software, ERP systems, and Microsoft Office Suite.\n\nStrong analytical and problem-solving capabilities.','Stanley Karanja',100000,0,'2025-01-26 10:01:55','2025-09-05 10:35:19'),(14,14,'2009-10-28','2009-10-28',NULL,'Executive Research Director',5,'Kenya','N/A','N/A',25000,0,'2025-01-26 10:01:55','2025-08-29 09:16:59'),(15,15,'2009-10-28','2009-10-28',NULL,'Chief Executive Officer',5,'Kenya','N/A','N/A',50000,0,'2025-01-26 10:01:55','2025-08-29 09:04:57'),(16,16,'2025-01-20','2025-03-19',NULL,'Business Development Officer',7,'Kenya','N/A','N/A',30000,0,'2025-02-04 13:56:38','2025-02-04 13:56:38'),(18,18,'2024-10-14','2024-10-14',NULL,'Business Development Officer',7,'Kenya','N/A','N/A',30000,0,'2025-02-04 13:56:39','2025-02-04 13:56:39'),(19,19,'2024-10-14','2024-10-14',NULL,'Business Development Officer',7,'Kenya','N/A','N/A',30000,0,'2025-02-04 13:56:39','2025-02-04 13:56:39'),(20,20,'2024-10-14','2024-10-14',NULL,'Business Development Officer',7,'Kenya','N/A','N/A',30000,0,'2025-02-04 13:56:39','2025-02-04 13:56:39'),(21,21,'2024-10-14','2024-10-14',NULL,'Business Development Officer',7,'Kenya','N/A','N/A',30000,0,'2025-02-04 13:56:39',