7'),(424,679,'2024-11-11','2026-07-13','2026-11-11','Human Resource Officer',3,'Kenya','N/A','Faith Gathoni',40000,0,'2025-07-07 08:48:13','2025-09-05 10:31:42'),(425,682,'2025-01-01','2025-01-04',NULL,'Logistics Manager and Business Developer',6,'Kenya','Logistics Manager and Business Developer','Florence Wambui',15000,0,'2025-07-10 12:05:10','2025-07-10 12:05:10'),(426,683,'2025-01-01','2025-01-04',NULL,'Driver',6,'Kenya','Driver','John Chege',15000,0,'2025-07-10 12:05:10','2025-07-10 12:05:10'),(427,684,'2025-01-01','2025-01-04',NULL,'Driver',6,'Kenya','Driver','John Chege',15000,0,'2025-07-10 12:05:10','2025-07-10 12:05:10'),(428,685,'2025-01-01','2025-01-04',NULL,'Driver',6,'Kenya','Driver','John Chege',15000,0,'2025-07-10 12:05:10','2025-07-10 12:05:10'),(429,686,'2025-05-30','2025-08-30',NULL,'Driver',6,'Kenya','Driver','John Chege',15000,0,'2025-07-10 12:05:11','2025-07-10 12:05:11'),(430,687,'2025-01-01','2025-01-04',NULL,'Driver',6,'Kenya','Driver','John Chege',15000,0,'2025-07-10 12:05:11','2025-07-10 12:05:11'),(431,691,'2025-01-10','2025-04-10','2042-01-10','BD & Logistics Coordinator',6,'Kenya','BD & Logistics Coordinator','Florence Wambui',25000,0,'2025-08-06 09:15:23','2025-08-06 09:15:23'),(432,692,'2024-12-02','2025-03-03','2034-12-02','Human Resource Business Partner',3,'Kenya','Human Resource Business Partner','Michael Gitaka',70000,0,'2025-08-06 10:58:27','2025-09-05 10:20:40'),(433,693,'2018-01-01','2018-04-02','2036-12-31','Technology Lead and Health & Safety Lead',4,'Kenya','Technology Lead and Health & Safety Lead\n\nIs responsible for overseeing the organization’s technology infrastructure, systems, and IT team. The role ensures efficient, secure, and reliable IT operations to support business objectives, while driving innovation, digital transformation, and continuous improvement.\n\nKey Responsibilities\n\nIT Strategy & Planning\n\nDevelop and implement the company’s IT strategy in alignment with business goals.\n\nPlan, budget, and forecast IT needs including infrastructure, software, and human resources.\n\nIdentify opportunities for adopting new technologies to improve efficiency and competitiveness.\n\nSystems & Infrastructure Management\n\nOversee installation, configuration, and maintenance of hardware, software, and networks.\n\nEnsure system availability, performance, and reliability.\n\nManage servers, databases, ERP/CRM systems, and cloud solutions.\n\nCybersecurity & Risk Management\n\nDevelop and enforce IT security policies and protocols.\n\nSafeguard company data and systems against breaches, malware, and cyber threats.\n\nEnsure compliance with relevant data protection regulations.\n\nTeam Leadership & Support\n\nLead, mentor, and develop IT staff to enhance skills and productivity.\n\nProvide technical support and troubleshooting for employees.\n\nFoster a culture of innovation and continuous learning within the IT department.\n\nVendor & Stakeholder Management\n\nManage relationships with IT service providers, consultants, and vendors.\n\nNegotiate contracts and service-level agreements.\n\nCollaborate with department heads to understand IT needs and provide solutions.\n\nProject & Change Management\n\nLead IT-related projects such as system upgrades, digital transformation, or new software implementation.\n\nManage change processes to minimize disruption and maximize adoption.\n\nMonitor progress and report on IT project outcomes.\n\nMonitoring, Reporting & Compliance\n\nTrack and report on IT performance metrics and system usage.\n\nPrepare regular reports for senior management on IT initiatives, risks, and progress.\n\nEnsure compliance with industry standards and legal requirements.','Michael Gitaka',70000,0,'2025-08-06 11:13:57','2025-09-05 10:37:42'),(434,694,'2025-07-16','2025-10-16','2030-12-31','Accountant',2,'Kenya','Accountant','Micheal Gitaka',70000,0,'2025-08-06 12:13:56','2025-08-06 12:13:56'),(435,695,'2025-07-22','2025-10-22','2026-07-21','Sales Marketing Lead',1,'Kenya','Customer marketing sales executive','Sylvia Ngurela',60000,0,'2025-08-06 12:27:08','2025-09-04 11:44:15'),(436,696,'2025-07-18','2025-10-18','2029-06-18','DRIVER',6,'Kenya','Driver','John Chege',15000,0,'2025-08-07 07:21:47','2025-08-07 07:21:47'),(437,700,'2021-01-01','2021-03-31','2030-12-31','Project Lead',5,'Kenya','Project Planning & Initiation\n\nDefine project scope, goals, deliverables, and timelines in alignment with organizational objectives.\n\nDevelop detailed project plans, schedules, and resource allocation strategies.\n\nIdentify risks, dependencies, and constraints early in the project cycle.\n\nTeam Leadership & Coordination\n\nLead, guide, and motivate project team members to achieve objectives.\n\nAssign tasks, monitor performance, and provide support or feedback.\n\nFacilitate collaboration and resolve conflicts within the team.\n\nStakeholder Management\n\nAct as the primary point of contact between the project team, management, and stakeholders.\n\nCommunicate project updates, progress, and challenges clearly and timely.\n\nManage stakeholder expectations and ensure alignment with project objectives.\n\nExecution & Monitoring\n\nOversee day-to-day project implementation to ensure milestones are achieved.\n\nMonitor progress against set targets, timelines, and budgets.\n\nTrack performance metrics and prepare regular status reports.\n\nQuality Assurance & Risk Management\n\nEnsure project deliverables meet required standards and specifications.\n\nIdentify, assess, and mitigate risks that could affect the project.\n\nImplement corrective measures for issues or delays.\n\nBudget & Resource Management\n\nManage project budgets, ensuring cost efficiency and accountability.\n\nOptimize the use of human, financial, and material resources.\n\nApprove project expenditures within authorized limits.\n\nDocumentation & Reporting\n\nMaintain comprehensive project documentation, including plans, reports, and evaluations.\n\nPresent updates to senior management and recommend process improvements.\n\nEnsure proper project closure and knowledge transfer after completion.\n\nContinuous Improvement\n\nCapture lessons learned for future projects.\n\nRecommend process enhancements to improve project delivery efficiency.\n\nFoster innovation and encourage best practices in project management.','Michael Gitaka',70000,0,'2025-08-29 07:14:46','2025-09-05 10:24:18'),(438,701,'2025-08-29','2025-11-29','2027-08-29','Location Manager',2,'Kenya','Location-based leave management and approval','HR Manager',80000,0,'2025-08-29 07:58:01','2025-08-29 07:58:01'),(439,702,'2025-08-29','2025-11-29','2027-08-29','Location Manager',2,'Kenya','Location-based leave management and approval','HR Manager',80000,0,'2025-08-29 08:29:48','2025-08-29 08:29:48'),(440,703,'2018-01-29','2018-03-29','2032-12-29','Senior Driver',6,'Kenya','Driver','Florence Wambui',17500,0,'2025-08-29 11:53:03','2025-08-29 11:53:03'),(441,704,'2024-06-01','2024-08-31','2025-05-30','Driver',6,'Kenya','Driver','Florence Wambui',15000,0,'2025-08-29 12:21:17','2025-08-29 12:21:17'),(442,705,'2022-10-01','2022-12-31','2030-12-31','Driver',6,'Kenya','Driver','Florence Wambui',15000,0,'2025-08-29 12:39:03','2025-08-29 12:39:03'),(443,706,'2021-01-04','2021-04-05','2040-12-28','Project Account Manager',5,'Kenya','Project Account Manager','Micheal Gitaka',50000,0,'2025-09-01 13:49:54','2025-09-01 13:49:54'),(444,707,'2025-08-01','2025-11-04','2026-08-04','BDR',7,'Kenya','Sales','Jane Nduta',44161,0,'2025-09-03 07:04:44','2025-09-19 14:20:57'),(445,708,'2025-08-01','2025-11-04','2026-08-04','BDR',7,'Kenya','Sales','Jane Nduta',44161,0,'2025-09-03 07:04:44','2025-09-19 14:20:57'),(446,709,'2025-08-01','2025-11-04','2026-08-04','BDR',7,'Kenya','Sales','Jane Nduta',44161,0,'2025-09-03 07:04:44','2025-09-19 14:20:57'),(447,710,'2025-08-01','2025-11-04','2026-08-04','BDR',7,'Kenya','Sales','Jane Nduta',44161,0,'2025-09-03 07:04:45','2025-09-19 14:20:57'),(448,711,'2025-08-01','2025-